import React, { Component } from 'react';

class HomeRightVideoHeighLights extends Component {
    constructor(props) {
        super(props);
        this.state = {
            error: null,
            isLoaded: false,
            videoHeighLights: [],
        };
    }

    componentDidMount() {

        fetch("https://back.cricwick.net/api/v1/user_api/home_videos?telco=mobilink")
            .then(res => res.json())
            .then(
                (result) => {
                    this.setState({
                        isLoaded: true,
                        videoHeighLights: result
                    });
                },

                // Handling Erro
                (error) => {
                    this.setState({
                        isLoaded: true,
                        error
                    });
                }
            )
    }

    render() {
        const {videoHeighLights} =  this.state; 
        console.log(videoHeighLights.timeline_videos);

        return (
            <div className="card">
                {videoHeighLights.timeline_videos.map((video, i) => (
                    <div>
                       {video.thumb}
                       {video.title}
                    </div>
                ))}
            </div>
        );
    }
}
 



export default HomeRightVideoHeighLights;
